use std::{str::FromStr, time::Instant};

use bytes::Bytes;
use primitive_types::H160;
use revm::{db::BenchmarkDB, TransactTo};

extern crate alloc;

pub fn simple_example() {
    let contract_data : Bytes = hex::decode("").unwrap().into();

    // BenchmarkDB is dummy state that implements Database trait.
    let mut evm = revm::new();
    evm.database(BenchmarkDB(contract_data));

    // execution globals block hash/gas_limit/coinbase/timestamp..
    evm.env.tx.caller = H160::from_str("0x1000000000000000000000000000000000000000").unwrap();
    evm.env.tx.transact_to =
        TransactTo::Call(H160::from_str("0x0000000000000000000000000000000000000000").unwrap());
    evm.env.tx.data = Bytes::from(hex::decode("30627b7c").unwrap());

    let mut elapsed = std::time::Duration::ZERO;
    let mut times = Vec::new();
    for _ in 0..10 {
        let timer = Instant::now();
        let (_, _, _, _, _) = evm.transact();
        let i = timer.elapsed();
        times.push(i);
        elapsed += i;
    }
    println!("elapsed: {:?}", elapsed / 10);
    for (i, time) in times.iter().enumerate() {
        println!("{}: {:?}", i, time);
    }
}

fn main() {
    println!("Hello, world!");
    simple_example();
    println!("end!");
}
